description:
Kendra's Hands On! Madelyn's Internship!

Dana's Recommendation! Jasmine's Special Delivery!

Kendra hires a new contractor to redo the master bedroom. Erik the new contractor has other plans for Kendra about what should be done in the bedroom. Madelyn is working really hard to finish off her internship with Mr. Rodgers. Madelyn starts to get stressed with her work and needs a break. Rodgers knows the best way to relieve her stress. Pete needs help with his after graduate courses, so he goes to Prof. Wrinkle-sfoot house. Things get hot and heavy when all he needs is a shiny recommendation from her. Evan's hard at work when the sexy delivery girl Jasmine disturbs him. Evan keeps talking about firing people, but what he doesn't realize it that it's getting Jasmine all fired up!

